INSERT INTO `predstave` (`id`, `naziv_predstave`, `opis_predstave`, `glumci`, `slike`) VALUES
(1, 'Romeo i Julija', 'Balet Romeo i Julija lirska je priča o tragičnim veronskim ljubavnicima na glazbu Sergeja Sergejeviča Prokofjeva, koja je od svojega nastanka 1938. godine neprekidno nadahnuće mnogih naraštaja koreografa i redatelja. To slavno baletno djelo nastalo je prema Shakespeareovoj drami Romeo i Julija, jednoj od najljepših, najtragičnijih i najčitanijih priča svjetske literature koja već četiri stoljeća služi kao nepresušno vrelo inspiracije autorima  različitih umjetničkih izričaja. Mnogi su skladatelji napisali glazbu za balet ili operu o nesretnim ljubavnicima, koji na početku života tragično skončaju zbog mržnje koja vlada između njihovih obitelji Capuleti i Montecchi. Baletno djelo, prema sinopsisu Sergeja Prokofjeva i Leonida Lavrovskoga, majstorska je glazbena partitura bogata umjetničkog izričaja. Prokofjevljeva glazba omogućila je plesati Shakespearea i njegove likove, koji su time dobili novu dimenziju. Ovim je baletom otvorena posve nova stranica u povijesti baletne umjetnosti. Djelo je djelomičnu svjetsku praizvedbu doživjelo izvan Rusije, u Brnu 30. prosinca 1938. godine, a u integralnoj je  verziji izvedeno11. siječnja 1940. godine u Marijinskome teatru u tadašnjemu Lenjingradu, u koreografiji Leonida Lavrovskog.', 'Julija: Miruna Miciu\\r\\nRomeo: Guilherme Gameiro Alves\\r\\nTibaldo: George Stanciu\\r\\nGrofica Capuleti: Natalia Horsnell\\r\\nMercuzio: Takuya Sumitomo\\r\\nBenvoglio: Simon Yoshida\\r\\nParis: Duilio Ingraffia\\r\\nGrof Capuleti: Azamat Nabiullin\\r\\nGrofica Montecchi: Milka Hribar Bartolović\\r\\nGrof Montecchi: Andrej Izmestjev\\r\\nRosalinda: Rieka Suzuki\\r\\nParisovi prijatelji: Kristian Manev, Ovidiu Muscalu\\r\\nMercuziovi prijatelji: George Baldovin, Eugen Dobrescu\\r\\nJulijina dojilja: Martina Fici\\r\\nPater Lorenzo: Andrej Barbanov', );
INSERT INTO `predstave` (`id`, `naziv_predstave`, `opis_predstave`, `glumci`, `slike`) VALUES
(2, 'Šuma Striborova', 'Šuma Striborova jedna je od najljepših hrvatskih bajki, omiljena i djeci i odraslima. Potječe iz ciklusa pripovijetki pod nazivom Priče iz davnine Ivane Brlić Mažuranić. U izgubljene svjetove drevne staroslavenske mitologije vode vas Senka Bulić i Stipe Kostanić.\\r\\nZbog svoje originalnosti i popularnosti među čitateljima Ivana Brlić Mažuranić često je nazivana hrvatskim Andersenom i Tolkienom. Priče iz davnine su objavljene davne 1916. godine, a do danas su prevedene na čak 50 jezika. Izgubljeni svjetovi drevne staroslavenske mitologije i hrvatske narodne predaje u njima se vraćaju u život, donoseći bezvremensku poruku Ljubavi i roditeljima i djeci.Pisana raskošnim i uzbudljivim stilom, Šuma Striborova je postala kultni tekst hrvatske dječje književnosti. Čuveni Stribor (Stribog) je bio slavenski bog vjetra i šume. Pod njegovim vječnim pogledom i s njegovim dopuštenjem, na kraju putovanja začaranom šumom, saznat ćemo što je najvrednije u životu.', 'Senka Bulić , Stipe Kostanić', );
INSERT INTO `predstave` (`id`, `naziv_predstave`, `opis_predstave`, `glumci`, `slike`) VALUES
(3, 'Jazavac u Kazalištu', 'Što se dogodilo s Jazavcem otkad je njegovo ime izbrisano iz naziva Satiričkog kazališta? Je li se vratio u Kočićevu dramu iz koje je i došao? Ili li se ponovno našao pred sudom? Je li njegovo mjesto na pozornici nacionalne zoologije zauzela etnički čista kuna?\\r\\n\\r\\nMlađe generacije Jazavca nikada nisu upoznale. Starije su ga, sukladno službenim kulturnim politikama, temeljito zaboravile. Što se događa kad se ovaj nezvani gost vrati u kazalište koje se nekada dičilo njegovim imenom? Pravimo li se i dalje da ne znamo tko je i što Jazavac?\\r\\n\\r\\nIpak, Jazavac kojeg ovdje upoznajemo nije onaj Kočićev, a još manje satiričko-kazališni. On je zajednički nazivnik za vrijeme u kojem su određena imena predstavljala opasnost za njihove vlasnike, vrijeme koje bi nam se, ako je ikada otišlo, u skoroj budućnosti moglo vratiti. Jazavac kojeg ovdje upoznajemo je neočekivani odraz koji pojedini od nas otkrivaju u ogledalu kad potraže svoj vlastiti lik. S Jazavcem, koji se vratio na mjesto zločina, mjesto na kojem je simbolički ubijen, vraća se i sjećanje koje je obrisano.', 'Hrvoje Kečkeš, Vilim Matula, Borko Perić, Rakan Rushaidat', );
INSERT INTO `predstave` (`id`, `naziv_predstave`, `opis_predstave`, `glumci`, `slike`) VALUES
(4, 'Disco svinje', 'Ovo je priča o mladim ljudima s ruba društva, ruba odgoja, ruba kojim se kreću opasni za sebe i druge. Kroz njihove postupke zrcali se društvo i obitelji bez previše nade.Oni su na pragu života, mladi, zaigrani, krhki, ogorčeni, divlji... Oni vrište na društvo koje ih je zaboravilo. Oni su sami i jedino imaju sebe. Oni se brane od svijeta tako što ga napadaju. Oni su poziv na razmišljanje roditeljima, odgojiteljima, profesorima, političarima... Oni vrište i traže komadić nade. Oni svoju mladu energiju oslobađaju u mraku klubova uz ritam disco glazbe.\\r\\nONI SU DISCO SVINJE. Ima li nade?!', 'Elizabeta Brodić, Matija Čigir, Ivana Gulin, Karlo Mrkša', );
INSERT INTO `predstave` (`id`, `naziv_predstave`, `opis_predstave`, `glumci`, `slike`) VALUES
(5, 'Munchhausen', 'O tome zašto čovjek laže i kako to čini napisano je bezbroj debelih knjiga. Umijeće laži što nam ga podastire barun Münchhausen plijeni bujnošću razmahane mašte. Njegove laži nisu međutim plod demagoškog manipuliranja zrncima istine. Takvim se lažima posvuda na našem planetu služe prepredeni pozemljari, čineći to na svim životnim razinama u obliku sofisticiranih biznismenskih trikova, visokoparnih kulturnjačkih prepucavanja i malignih političarskih smicalica. Münchausenovi lažopleti spram svega ovoga benigne su floskule koje nas poput čarolije umiju nasmijati do suza, pomažući nam da ne zaboravimo kako funkcionira istinski smijeh, taj osebujni mehanizam koji bi čovjeku, kada bi za njim češće posezao, možda i mogao donijeti stanovito samoizlječenje.', 'Vilim Borić', );

